import React, { useState, useEffect } from 'react';
import Jumbotron from '../components/Jumbotron';

function Home() {
    const [data, setData] = useState([{}]);

    useEffect(() => {
        fetch("/home").then(
            res => res.json()
        ).then(
            data => {
                setData(data)
            }
        )
    }, [])

    return (
        <div>
            <Jumbotron />
            <p>{data.Greeting}</p>
            <p>{data.Message}</p>
        </div>
    )
}

export default Home;
